    // console.log(icon)


    return (
        <div>
        <li className='card'>
            <h4>{artist}</h4>
            {/* <img className="card-image" src={image} alt={title} /> */}
            <img className="card-image" src={icon} alt={title} />
            <p>{title}</p>
            <p>{price}</p>
            <p>{description}</p>
        </li>
        </div>
    )
}

